  render(){

    const { photos } = this.state;

    return(
      <div>
        <div id="navbar">
          <Instatype 
            placeholder="Search Unsplash" 
            requestHandler={this.requestHandlerThrottled}
            selectedHandler={this.selectedHandler}
            limit={10} 
            thumbStyle="circle"/>
        </div>

        { photos && photos.length > 0 && 
          <div style={{ overflowX: 'hidden' }}>
            <Grid blocksPerRow={4} blockSpacing={4} hideOuterSpacing={true}>
              {photos.map(photo => (     
                <a href={photo.links.html} target="_blank" key={photo.id} >
                  <img src={'https://source.unsplash.com/' + photo.id +'/400x400'} style={{ display: 'block', width: '100%' }}/> 
                </a>
              ))}
            </Grid>
          </div>
        }
      
        { photos && photos.length === 0 &&
          <div style={{ fontSize: '2em', textAlign: 'center', marginTop: '2em', color: '#6e6e6e' }}>
            This user has no photos :(
          </div>
        }
      </div>
    )
  }
